import React from "react";
function CreateTicket() {
  return (
    <div className="row">
      <h1>To create a ticket, select a relevant topic</h1>
      <div className="col-4">
        <p>
          <i class="fa fa-plus-circle" aria-hidden="true"></i>Account Opening
        </p>
        <ul>
          Online Account Opening
           Offline Account OpeniRg Company, Partnership
          and HUF Account Opening NRI Account Opening Charges at Zerodha Zerodha
          DFC FIRST Bank 3-in-l Account Getting Started
        </ul>
      </div>
      <div className="col-4"></div>
      <div className="col-4"></div>
    </div>
  );
}

export default CreateTicket;
